import React, { useState, useEffect } from "react";
import axios from "axios";
import { useHistory } from "react-router-dom";

const ArtistProfile = () => {
  const history = useHistory();
  const token = localStorage.getItem("token");
  const userId = localStorage.getItem("userId"); // Get user ID from localStorage

  const [profile, setProfile] = useState({
    bio: "",
    specialization: "",
    experience: "",
    email: "",
    location: "",
    profileImage: "",
    rating: "",
    phoneNumber: "",
  });

  useEffect(() => {
    if (userId) {
      fetchArtistProfile();
    }
  }, [userId]);

  const fetchArtistProfile = async () => {
    try {
      const response = await axios.get(`http://localhost:8080/api/artists/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setProfile(response.data);
    } catch (error) {
      console.error("Error fetching artist profile:", error);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile((prev) => ({ ...prev, [name]: value }));
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setProfile((prev) => ({ ...prev, profileImage: file }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const apiUrl = userId
        ? `http://localhost:8080/api/artists/update/${userId}`
        : `http://localhost:8080/api/artists/create`;

      const response = await axios({
        method: userId ? "PUT" : "POST",
        url: apiUrl,
        data: profile,
        headers: {
          Authorization: `Bearer ${token}`,
          "Content-Type": "application/json",
        },
      });

      alert(response.data);
      history.push("/artist-dashboard"); // Redirect to dashboard (React Router v5)
    } catch (error) {
      console.error("Error saving artist profile:", error);
      alert("Failed to save profile.");
    }
  };

  return (
    <div className="profile-container">
      <h2>Artist Profile</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" name="bio" placeholder="Your Bio" value={profile.bio} onChange={handleChange} required /><br />
        <input type="text" name="specialization" placeholder="Specialization" value={profile.specialization} onChange={handleChange} /><br />
        <input type="text" name="experience" placeholder="Experience (years)" value={profile.experience} onChange={handleChange} /><br />
        <input type="email" name="email" placeholder="Email" value={profile.email} onChange={handleChange} required /><br />
        <input type="text" name="location" placeholder="Location" value={profile.location} onChange={handleChange} /><br />
        <input type="tel" name="phoneNumber" placeholder="Phone Number" value={profile.phoneNumber} onChange={handleChange} required /><br />
        <input type="number" name="rating" placeholder="Rating (1-5)" value={profile.rating} onChange={handleChange} min="1" max="5" /><br />
        <input type="file" name="profileImage" accept="image/*" onChange={handleFileChange} /><br /><br />
        <button type="submit">{userId ? "Update Profile" : "Create Profile"}</button>
      </form>
    </div>
  );
};

export default ArtistProfile;
